import React, {useEffect, useState} from 'react'
import { useParams } from 'react-router-dom'
import axios from 'axios';

function Patient() {
    let {id} = useParams();
    const [patient, setPatient] = useState({});
    const [clinic, setClinic] = useState({});
    
    useEffect(()=>{
        axios.get(`http://localhost:3001/patient/byId/${id}`).then((response)=>{
          setPatient(response.data);
        })
      },[])

    
    useEffect(()=>{
      axios.get(`http://localhost:3001/patient/clinic/byId/${patient.department_id}`).then((response)=>{
        setClinic(response.data);
      })
    },[])

  return (
    <div>
    <div>ชื่อ: {patient.name}</div>
    <div>อายุ: {patient.age}</div>
    <div>สาขา: {clinic.department}</div>
    </div>
  )
}

export default Patient
